import React from "react";
import banner_1 from "../assets/banner_1.jpg";
import banner_small_1 from "../assets/banner_small_1.jpg";

const Banner: React.FC = () => {
  return (
    <div className="flex flex-col gap-10 lg:gap-20 justify-between pt-2 mb-6 mx-4">
      <div className="flex gap-4 items-center flex-shrink-0 box-border max-w-4xl max-h-fit">
        <a href="/">
          <img src={banner_1} alt="banner_1" />
        </a>
      </div>
      <div className="flex gap-4 items-center flex-shrink-0 box-border max-w-lg max-h-fit">
        <a href="/">
          <img src={banner_small_1} alt="banner_1" />
        </a>
      </div>
    </div>
  );
};

export default Banner;
